package assignment;

public class Multiplication {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=0;i<13;i++) {
			System.out.println("Multiplication Table of "+i+" :");
			for(int j=0;j<13;j++) {
				System.out.println(i+"x"+j+" = "+i*j);
			}
		}
	}

}
